style.css:
/* Remove Discord Nitro nag bar */
div[class^="container-"] > div:nth-child(2) > div > div:nth-child(2) {
    display: none !important;
}

/* Change background color */
body {
    background-color: #780000 !important;
}

/* Change text color */
span, div, p, h1, h2, h3, h4, h5, h6 {
    color: #ffffff !important;
}

/* Change channel list width */
div[class^="container-"] > div:nth-child(2) > div > div:nth-child(1) {
    width: 220px !important;
}

/* Change channel list background color */
div[class^="container-"] > div:nth-child(2) > div > div:nth-child(1) {
    background-color: #23272a !important;
}

/* Change channel list text color */
div[class^="container-"] > div:nth-child(2) > div > div:nth-child(1) span, div[class^="container-"] > div:nth-child(2) > div > div:nth-child(1) div, div[class^="container-"] > div:nth-child(2) > div > div:nth-child(1) p {
    color: #ffffff !important;
}

/* Change message background color */
div[class^="container-"] > div:nth-child(2) > div > div:nth-child(2) {
    background-color: #36393f !important;
}

/* Change message text color */
div[class^="container-"] > div:nth-child(2) > div > div:nth-child(2) span, div[class^="container-"] > div:nth-child(2) > div > div:nth-child(2) div, div[class^="container-"] > div:nth-child(2) > div > div:nth-child(2) p {
    color: #ffffff !important;
}

/* Change message scrollbar color */
::-webkit-scrollbar {
    width: 8px;
    background-color: #2c2f33;
}

::-webkit-scrollbar-thumb {
    background-color: #7289da;
    border-radius: 4px;
}
